    public string GetGalleryID(string idName)
    {
        if (campIdNum < 9)
            return idName+"_00" + campIdNum;
        else if (campIdNum < 99)
            return idName+"_0" + campIdNum;
        else 
            return idName+"_" + campIdNum;
    
    }

    public void IncrementCampID()
    {
        campIdNum++;
    }

    public void ResetCampID()
    {
        campIdNum = 0;
